    false,nt"url": null,nt"notes": "Digital surfaces and thicknesses of selected
    hydrogeologic units of the Floridan aquifer system were developed to define an updated
    hydrogeologic framework as part of the U.S. Geological Survey Groundwater Resources
    Program. This feature class contains well locations where transmissivity estimates
    were compiled and used for the regional transmissivity map. The well site data contains
    1487 transmissivity estimates, in units of feet squared per day. The data was collected
    using two different testing methods, single- and multi-well aquifer tests (APT)
    and specific capacity (SPC), 1045 and 442 values respectively.",nt"license_title":
